import React, {memo} from 'react';
import styled from 'styled-components';

const IntroduceContainer = styled.div`
    background-color: #333;
    width:100%;
`;

const Introduce = memo(() => {
  return (
    <IntroduceContainer>
      <h1>Introduce</h1>
    </IntroduceContainer>
  );
});

export default Introduce;
